import React from 'react';
import { AppBar, Toolbar, Typography, Button } from '@mui/material';
import { motion } from 'framer-motion';
import HomeIcon from '@mui/icons-material/Home';
import PhotoLibraryIcon from '@mui/icons-material/PhotoLibrary';
import ContactMailIcon from '@mui/icons-material/ContactMail';

const Navbar = () => {
  return (
    <AppBar position="static" sx={{ backgroundColor: '#333' }}>
      <Toolbar>
        <motion.div initial={{ x: -100 }} animate={{ x: 0 }} transition={{ duration: 0.5 }}>
          <Typography variant="h6" sx={{ flexGrow: 1 }}>
            Galería Virtual de Arte
          </Typography>
        </motion.div>
        <motion.div whileHover={{ scale: 1.1 }}>
          <Button color="inherit" startIcon={<HomeIcon />}>Inicio</Button>
        </motion.div>
        <motion.div whileHover={{ scale: 1.1 }}>
          <Button color="inherit" startIcon={<PhotoLibraryIcon />}>Galería</Button>
        </motion.div>
        <motion.div whileHover={{ scale: 1.1 }}>
          <Button color="inherit" startIcon={<ContactMailIcon />}>Contacto</Button>
        </motion.div>
      </Toolbar>
    </AppBar>
  );
};

export default Navbar;
